import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the profile link and click it
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Wait for profile information to load
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const extractedData = await page.evaluate(() => {
      const username = document.querySelector('.username')?.textContent || '';
      const fullName = document.querySelector('.profile-info h2')?.textContent || '';
      const bio = document.querySelector('.bio')?.textContent || '';
      const totalOrders = document.querySelector('.stat-number')?.textContent || '';
      const totalReviews = document.querySelectorAll('.stat-number')[1]?.textContent || '';
      const sellerRating = document.querySelectorAll('.stat-number')[2]?.textContent || '';
      return {
        username,
        fullName,
        bio,
        totalOrders,
        totalReviews,
        sellerRating
      };
    });

    return {
      success: true,
      action: "Profile information harvested successfully",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
